    true,nt"url": null,nt"notes": "This file consists primarily of terrain
    data on a SOM Grid. It has 233 parts, corresponding to the 233 repeat orbits of
    the EOS-AM1 Spacecraft. (Suggested Usage: The AGP file consists primarily of terrain
    data on an SOM grid.It is utilized throughout the mission & is needed to interpret
    the products.The AGP consists of 233 parts,corresponding to the 233 repeat orbits
    of the EOS spacecraft.The map scale is 1.1 km;this defines the horizontal sampling
    for each of the parameters.The horizontal datum or surface-basis,for the projection
    is the WGS84 ellipsoid. This map projection and surface-basis is what is used for
    all L1B2 and L2 parameters.)",nt"license_title": "U.S. Government Work",nt"extras":
